- input: "TEXT\x1CC00001305\x1C.TEXT\x1C\x1CF3XA\x1CIn response to your letter of
    October 20,2004 in reference to our August Monthly report (7/1/04-7/31/04).  Our
    ID # is C00001305.  The memo text was a clerical error and has been removed per
    this amendment.  All salaries have been moved to the correct line (30b), as well
    as any fringe benefits.  The questioned payments for 'direct mail' in the amount
    of $14,036.27 were ALL designated as Category C - 'Solicitation and Fundraising
    Expenses'.  None were for candidates.  This amendment corrects the payment to
    Villa Park Associates as an allocable expense as it should have been, and the
    payment to Va. Commonwealth for insurance, was for our crime policy and not employee
    benefits.   The voided check to Radisson Ft. McGruder would require a split deposit,
    however, funds have not allowed us to transfer all allocable expenses from our
    non-federal, therefore this should not be an issue.  If there are further questions,
    please feel free to contact us."
